import React from 'react';
// import '../App.css';


import '../../././assets/css/MainPAge.css'

const content = ()=>{
    return (
        <main>
            <div align="center">
                {/*<button className="buttons" type="button" href='#'>*/}
                {/*    <img align='left' className="icons" src={require( '../.././assets/image/Asset 4.png')} alt="Map"/>*/}
                {/*    <p>Map</p>*/}
                {/*</button>*/}
                <button className="buttons" type="button" href='#'>
                    <img align='left' className="icons" src={require( '../.././assets/image/Asset 7.png')} alt="Schedule"/>
                        <p>Schedule</p>
                </button>
            </div>
            <br/>
            <div align="center">
                <button className= "buttons" type="button" href='#'>
                    <img align='left' className="icons" src="../image/Asset 5.png" alt="Faculties"/>
                        <br/>Faculties<br/>
                </button>
                <button className="buttons" type="button" href='#'>
                    <img align='left' className="icons" src="../image/Asset 10.png" alt="Institutes"/>
                        <br/>Institutes<br/>
                </button>
            </div>
            <br/>
            <div align="center">
                <button className="buttons" type="button" href='#'>
                    <img align='left' className="icons" src="../image/Asset 3.png" alt="History"/>
                        <br/>History<br/>
                </button>
                <button className="buttons" type="button" href='#'>
                    <img align='left' className="icons" src="../image/Asset 5.png" alt="Information"/>
                        <br/>Information<br/>
                </button>
            </div>
        </main>
    );
}

export default content;
